import React from "react";

const About: React.FC = () => {
  return (
    <div className="about-container">
      <h1>How we see it differently</h1>
      <p>The global Souuth is rapidly catching up with the "developed" world. It's time for you to get to know the rapid development , innovation and drive going on in this part of the world(East-Africa, South Asia and beyond).</p>
      <img src="https://res.cloudinary.com/dyl3rncv3/image/upload/c_scale,w_1280/v1675690306/elewa-group-website/Images/Mask_Group_17_rjkgrq.png" alt="About Us" />
    </div>
  );
};

export default About;
